import React from 'react';

function WareHouse(props){
    return(
        <div>
            <form>
            <h4>Add New items in stock</h4>
                <select>
                    <label>Location</label>     
                    <option value="WareHouse#1">WareHouse#1</option>
                    <option>WareHouse#2</option>
                    <option>Shop</option>
                </select>
            </form>
        </div>
    );
}
export default WareHouse;
